void qr_decompose(
  complex_float A[4][4],
  complex_float Q[4][4],
  complex_float R[4][4])
{_ssdm_SpecArrayDimSize(A, 4);_ssdm_SpecArrayDimSize(Q, 4);_ssdm_SpecArrayDimSize(R, 4);
 hls::qrf<false, 4, 4, complex_float, complex_float> (A, Q, R);
}
void eig_decompose(complex_float Rx[4][4], complex_float U[4][4], float eigval[4]) {_ssdm_SpecArrayDimSize(Rx, 4);_ssdm_SpecArrayDimSize(U, 4);_ssdm_SpecArrayDimSize(eigval, 4);
 complex_float Q_temp[4][4];
 complex_float R_temp[4][4];
 complex_float Rx_temp[4][4];
 complex_float eig_mat[4][4];
 complex_float temp;
 complex_float mid, sum;
 float midsum;

 for(int i = 0; i < 4; i++) {
  for(int j = 0; j < 4; j++) {
   eig_mat[i][j] = Rx[i][j];
   Rx_temp[i][j] = Rx[i][j];
  }
 }
 for(int i = 0; i < 30; i++) {
  qr_decompose(eig_mat, Q_temp, R_temp);
  for(int i = 0; i < 4; i++) {
   for(int j = 0; j < 4; j++) {
    temp.real(0);
    temp.imag(0);
    for (int k = 0; k < 4; k++) {
     temp += R_temp[i][k] * Q_temp[k][j];
    }
    eig_mat[i][j] = temp;
   }
  }
 }
 for(int count = 0; count < 4; count++) {
  eigval[count] = eig_mat[count][count].real();
  for(int i = 0; i < 4; i++) {
   Rx_temp[i][i] = Rx[i][i] - eigval[count];
  }
  for(int i = 0; i < 4 - 1; i++) {
   mid = Rx_temp[i][i];
   for(int j = i; j < 4; j++) {
    Rx_temp[i][j] /= mid;
   }
   for(int j = i + 1; j < 4; j++) {
    mid = Rx_temp[j][i];
    for(int q = i; q < 4; q++) {
     Rx_temp[j][q] -= mid * Rx_temp[i][q];
    }
   }
  }
  midsum = 1;
  U[4 - 1][count] = 1;
  for(int m = 4 - 2; m >=0; --m) {
   sum = 0;
   for(int j = m + 1; j < 4; j++) {
    sum += Rx_temp[m][j] * U[j][count];
   }
   sum = -sum / Rx_temp[m][m];
   midsum += sum.real() * sum.real() + sum.imag() * sum.imag();
   U[m][count] = sum;
  }
  midsum = sqrt(midsum);
  for(int i = 0; i < 4; i++) {
   U[i][count] /= midsum;
  }
 }
}
